import React, { useState } from "react";
import Map from "./Map";

const useSelectArea = () => {
  const [selectedArea, setSelectedArea] = useState('Littleroot Town');

  const changeSelectedArea = (e: string) => {
    setSelectedArea(e)
  }

  return {
    selectedArea ,
    changeSelectedArea
  }
}

export default function Game() {
    const selectedArea = useSelectArea();

    return (
    <React.Fragment>
      <div style={
      {"position": "absolute",
      "left": "50%",
      "top": "30%",
      "transform": "translate(-50%, -50%)",
      }} > 
        <Map />

            </div>
      <p>{selectedArea}</p>
      <button> Start </button>


    </React.Fragment>
  )

}
